window.bookSummaryJSON = "<p>The fae king is growing on me. Every touch, look, and night spent in his arms is slowly melting my resistance. When his feral side takes over, something inside me wants to let go and give him everything. With each passing day, the pull is getting harder to deny. But the road to the winter realm is full of danger, and I need to concentrate on finding my way home, not on the promises of pleasure Leander whispers in my ear at night. Even so, how long can I resist the intoxicating kiss of winter?</p>"; 
